import React, { Component } from 'react'

export default class Home extends Component {
    render(props) {

        let newlist = props.users.map((user)=>{
            return (
                <Home  post={user.post[0]}/> 
            )
        })

        return (
            <div>
               {newlist[0]}
            </div>
        )
    }
}
